
DROP TABLE IF EXISTS vypil;
DROP TABLE IF EXISTS navstivil;
DROP TABLE IF EXISTS capuje;
DROP TABLE IF EXISTS lubi;

CREATE TABLE lubi (
    Pijan TEXT,
    Alkohol TEXT
);

CREATE TABLE capuje (
    Krcma TEXT,
    Alkohol TEXT,
    Cena DECIMAL
);

CREATE TABLE navstivil (
    Id INTEGER PRIMARY KEY,
    Pijan TEXT,
    Krcma TEXT,
    Od INTEGER
);

CREATE TABLE vypil (
    Id INTEGER,
    Alkohol TEXT,
    Mnozstvo DECIMAL
);



